    playbackData.comments = {"f51b0106-ca77-4bbd-892e-af84fa655c5d":[{"id":"a9abe4c3-c77b-4104-af6b-220b81b36bdc","displayCommentEventId":"f51b0106-ca77-4bbd-892e-af84fa655c5d","displayCommentEventSequenceNumber":0,"developerGroupId":"22f393e8-56f0-4b6c-b088-fb18b4b6d9f9","timestamp":1693865473115,"commentText":"<span style=\"background-color: rgb(59, 76, 98);\">In this example we'll consider more complex data declarations and their applications.</span><div style=\"background-color: rgb(59, 76, 98);\"><br></div><div style=\"background-color: rgb(59, 76, 98);\">In particular, we will model the \"whole pie\" portion of the&nbsp;<a href=\"https://order.online/store/sweet-basil-pizzeria-walla-walla-536006/?hideModal=true&amp;pickup=true\">menu offered by Sweet Basil Pizza in Walla Walla</a>.</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"a2b49249-235f-4d6f-ae5d-91934cb92614":[{"id":"29728a37-5cec-499d-aa8f-5bd9eac7f822","displayCommentEventId":"a2b49249-235f-4d6f-ae5d-91934cb92614","displayCommentEventSequenceNumber":144,"developerGroupId":"f5dce1dd-047e-49d4-b9dc-495ccfaec7ee","timestamp":1693865606841,"commentText":"First, Sweet Basil offers a number of speciality pizzas, including the eponymous Sweet Basil pizza. Let's declare a data type listing these options.<div><br></div><div>(I haven't listed them all, just a representative sample.)</div>","commentTitle":"Modeling specialty pizza options","position":0,"selectedCodeBlocks":[{"fileId":"ae66c597-1aa7-4fb0-b11a-3f8a8f89ec81","selectedText":"data Speciality = Margherita | Italiano | Luau | Combo\n  | BeastMode | SweetBasil | Pesto | ChickenPesto | BBQ","startRow":2,"startColumn":0,"endRow":3,"endColumn":55}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"data Speciality = Margherita | Italiano | Luau | Combo\n  | BeastMode | SweetBasil | Pesto | ChickenPesto | BBQ","commentTags":[],"questionCommentData":null}],"9dc4792c-9bc7-41fe-8b60-f0d1835fdc96":[{"id":"f2514501-f52f-4835-9c68-767f40abd7ff","displayCommentEventId":"9dc4792c-9bc7-41fe-8b60-f0d1835fdc96","displayCommentEventSequenceNumber":420,"developerGroupId":"f5dce1dd-047e-49d4-b9dc-495ccfaec7ee","timestamp":1693865651931,"commentText":"Sweet Basil offers a lot of toppings, all for the same price. Let's list those too.","commentTitle":"Modeling toppings","position":0,"selectedCodeBlocks":[{"fileId":"ae66c597-1aa7-4fb0-b11a-3f8a8f89ec81","selectedText":"data Topping = Basil | ArtichokeHearts | Bacon | BellPepper\n  | Chicken | FetaCheese | Garlic | Ham | Jalapeno \n  | KalamataOlive | Mushroom | Olive | Onion | Pepperoni \n  | Pineapple | RicottaCheese | RoastedRedPepper\n  | Salami | Sausage | Spinach | SunDriedTomato","startRow":5,"startColumn":0,"endRow":9,"endColumn":47}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"data Topping = Basil | ArtichokeHearts | Bacon | BellPepper\n  | Chicken | FetaCheese | Garlic | Ham | Jalapeno \n  | KalamataOlive | Mushroom | Olive | Onion | Pepperoni \n  | Pineapple | RicottaCheese | RoastedRedPepper\n  | Salami | Sausage | Spinach | SunDriedTomato","commentTags":[],"questionCommentData":null}],"fd38e6ff-02cc-4fdf-b8aa-7644809c37b7":[{"id":"1b427fbe-fca0-4ea7-9a1b-2e40f7d8659e","displayCommentEventId":"fd38e6ff-02cc-4fdf-b8aa-7644809c37b7","displayCommentEventSequenceNumber":498,"developerGroupId":"f5dce1dd-047e-49d4-b9dc-495ccfaec7ee","timestamp":1693865778716,"commentText":"Sweet Basil offers two different sizes of pizzas: a personal 10\" pizza and an 18\" pizza to share. The specialty pizzas only come in the larger size.<div><br></div><div>Sweet Basil also offers a gluten-free crust, although the menu shows it for only the smaller pizza size.</div>","commentTitle":"Modeling sizes and crust options","position":0,"selectedCodeBlocks":[{"fileId":"ae66c597-1aa7-4fb0-b11a-3f8a8f89ec81","selectedText":"data Size = TenInch | EighteenInch\ndata Crust = Regular | GlutenFree","startRow":11,"startColumn":0,"endRow":12,"endColumn":33}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"data Size = TenInch | EighteenInch\ndata Crust = Regular | GlutenFree","commentTags":[],"questionCommentData":null}],"1a4fbbe0-e026-443d-9347-2959eb9ce62a":[{"id":"7b076f83-997d-465d-9212-429fea8bc9b7","displayCommentEventId":"1a4fbbe0-e026-443d-9347-2959eb9ce62a","displayCommentEventSequenceNumber":537,"developerGroupId":"f5dce1dd-047e-49d4-b9dc-495ccfaec7ee","timestamp":1693865916731,"commentText":"Finally, let's put it all together with the <span style=\"font-family: Courier;\">Pizza</span> type. Our first option is to choose a specialty pizza. They only come in one size (18\") and with one crust option (regular) so we leave those options out of our model.<div><br></div><div>We can define a specialty pizza like so:</div><div><br></div><div><span style=\"font-family: Courier;\">SpecialPie Combo</span></div>","commentTitle":"Modeling specialty pizzas","position":0,"selectedCodeBlocks":[{"fileId":"ae66c597-1aa7-4fb0-b11a-3f8a8f89ec81","selectedText":"data Pizza = SpecialPie Speciality\n","startRow":14,"startColumn":0,"endRow":15,"endColumn":0}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"data Pizza = SpecialPie Speciality\n  ","commentTags":[],"questionCommentData":null}],"08d99695-bb86-4404-9dd3-e0d0266385e3":[{"id":"38237ffe-8909-4649-ad5d-4dc1df47db1c","displayCommentEventId":"08d99695-bb86-4404-9dd3-e0d0266385e3","displayCommentEventSequenceNumber":616,"developerGroupId":"f5dce1dd-047e-49d4-b9dc-495ccfaec7ee","timestamp":1693866261334,"commentText":"Sweet Basil also lets us build a pizza with one or two toppings, for example:<div><br></div><div><span style=\"font-family: Courier;\">OneToppingPie EighteenInch Regular Pepperoni</span><span style=\"font-family: Courier;\"><br></span></div><div><span style=\"font-family: Courier;\"><br></span></div><div><span style=\"font-family: Courier;\">OneToppingPie TenInch GlutenFree Chicken</span></div><div><span style=\"font-family: Courier;\"><br></span></div><div><span style=\"font-family: Courier;\">TwoToppingPie TenInch Regular Olive Mushroom</span></div><div><br></div><div>Just as you can think of <span style=\"font-family: Courier;\">Size</span>, <span style=\"font-family: Courier;\">Crust</span>, and <span style=\"font-family: Courier;\">Topping</span> as defining sets of options, you can think of these <span style=\"font-family: Courier;\">Pizza</span> constructors as defining Cartesian products on those sets:</div><div><br></div><div>Size x Crust x Topping&nbsp;&nbsp;</div><div>or&nbsp;</div><div>Size x Crust x Topping x Topping</div><div><br></div><div>How many one-topping pizzas can you build? How many two-topping pizzas can you build?</div>","commentTitle":"Modeling custom pizzas","position":0,"selectedCodeBlocks":[{"fileId":"ae66c597-1aa7-4fb0-b11a-3f8a8f89ec81","selectedText":"  | OneToppingPie Size Crust Topping\n  | TwoToppingPie Size Crust Topping Topping","startRow":15,"startColumn":0,"endRow":16,"endColumn":44}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"  | OneToppingPie Size Crust Topping\n  | TwoToppingPie Size Crust Topping Topping","commentTags":[],"questionCommentData":null}],"ff51a247-e1de-4d2c-b066-73585a033fa0":[{"id":"2e8f0bed-f500-4b98-8d34-31c505036a7f","displayCommentEventId":"ff51a247-e1de-4d2c-b066-73585a033fa0","displayCommentEventSequenceNumber":885,"developerGroupId":"f5dce1dd-047e-49d4-b9dc-495ccfaec7ee","timestamp":1693866490936,"commentText":"In our declaration of <span style=\"font-family: Courier;\">main</span>, let's try showing some pizzas. Unfortunately, we encounter an error:<div><br></div><div><span style=\"font-family: Courier;\">No instance for (Show Pizza) arising from a use of ‘show’</span><br></div>","commentTitle":"Printing pizzas","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"8189c71c-eacd-4e69-bcfb-2bf8d15e9032":[{"id":"e038c9e5-1dca-4af9-b640-856f10ed9513","displayCommentEventId":"8189c71c-eacd-4e69-bcfb-2bf8d15e9032","displayCommentEventSequenceNumber":997,"developerGroupId":"f5dce1dd-047e-49d4-b9dc-495ccfaec7ee","timestamp":1693866730302,"commentText":"Fortunately, Haskell provides an easy solution. To make our new types \"showable\", we add to each new type the incantation&nbsp;<div><br></div><div><span style=\"font-family: Courier;\">deriving show</span></div><div><br></div><div>This causes the Haskell compiler to automatically generate implementations of the <span style=\"font-family: Courier;\">show</span> method for our new data types.&nbsp;</div><div><br></div><div>Now when we run our program, we will see the expected output:</div><div><br></div><div><div style=\"color: rgb(204, 204, 204); background-color: rgb(31, 31, 31); font-family: Menlo, Monaco, &quot;Courier New&quot;, monospace; font-size: 12px; line-height: 18px; white-space: pre;\"><div>SpecialPie Combo</div><div>OneToppingPie EighteenInch Regular Pepperoni</div><div>OneToppingPie TenInch GlutenFree Chicken</div><div>TwoToppingPie TenInch Regular Olive Mushroom</div></div></div><div><br></div>","commentTitle":"Deriving the show typeclass","position":0,"selectedCodeBlocks":[{"fileId":"ae66c597-1aa7-4fb0-b11a-3f8a8f89ec81","selectedText":"deriving Show","startRow":8,"startColumn":4,"endRow":8,"endColumn":17}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"    deriving Show","commentTags":[],"questionCommentData":null}],"4d714154-f852-4164-86db-6739d6b9b439":[{"id":"bb24ecf9-b647-405e-8e58-e4415284672a","displayCommentEventId":"4d714154-f852-4164-86db-6739d6b9b439","displayCommentEventSequenceNumber":1461,"developerGroupId":"f5dce1dd-047e-49d4-b9dc-495ccfaec7ee","timestamp":1693866989643,"commentText":"Finally, we add a price function. Pattern matching is very important here.<div><br></div><div>Most specialty pizzas are $26.50, so we use that for the default or wildcard case. But we provide other cases for specialty pizzas that have different prices.</div><div><br></div><div>The pricing of custom pizzas depends only on the size, crust, and number of toppings. We don't care what the toppings are, so we use wildcards.</div><div><br></div><div>The menu has prices for 10\" pizzas with one or two toppings and regular or gluten-free crust, as well as an 18\" one-topping pizza with a regular crust. The menu does not list prices for other possible combinations, so we just leave them out.</div>","commentTitle":"Implementing a price function","position":0,"selectedCodeBlocks":[{"fileId":"ae66c597-1aa7-4fb0-b11a-3f8a8f89ec81","selectedText":"price :: Pizza -> Double\nprice (SpecialPie SweetBasil) = 26.00\nprice (SpecialPie BeastMode) = 27.75\nprice (SpecialPie Luau) = 27.75\nprice (SpecialPie BBQ) = 27.75\nprice (SpecialPie _) = 26.50\nprice (OneToppingPie TenInch Regular _) = 15.50\nprice (OneToppingPie TenInch GlutenFree _) = 16.75\nprice (OneToppingPie EighteenInch Regular _) = 22.50\nprice (TwoToppingPie TenInch Regular _ _) = 16.75\nprice (TwoToppingPie TenInch GlutenFree _ _) = 17.75","startRow":25,"startColumn":0,"endRow":35,"endColumn":52}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"price :: Pizza -> Double\nprice (SpecialPie SweetBasil) = 26.00\nprice (SpecialPie BeastMode) = 27.75\nprice (SpecialPie Luau) = 27.75\nprice (SpecialPie BBQ) = 27.75\nprice (SpecialPie _) = 26.50\nprice (OneToppingPie TenInch Regular _) = 15.50\nprice (OneToppingPie TenInch GlutenFree _) = 16.75\nprice (OneToppingPie EighteenInch Regular _) = 22.50\nprice (TwoToppingPie TenInch Regular _ _) = 16.75\nprice (TwoToppingPie TenInch GlutenFree _ _) = 17.75","commentTags":[],"questionCommentData":null}],"95aa864d-1eaa-4214-8358-ac3bced47617":[{"id":"8d3d1856-7b02-4f7d-81e4-4732553cabac","displayCommentEventId":"95aa864d-1eaa-4214-8358-ac3bced47617","displayCommentEventSequenceNumber":1630,"developerGroupId":"f5dce1dd-047e-49d4-b9dc-495ccfaec7ee","timestamp":1693867185529,"commentText":"Let's define another function, which has a <span style=\"font-family: Courier;\">Pizza</span> input and a <span style=\"font-family: Courier;\">String</span> output. The result will be a nicely formatted string describing the pizza and giving its price. You could imagine a string like this appearing on an order ticket or receipt.","commentTitle":"Another function definition","position":0,"selectedCodeBlocks":[{"fileId":"ae66c597-1aa7-4fb0-b11a-3f8a8f89ec81","selectedText":"showPizzaPrice :: Pizza -> String\nshowPizzaPrice pizza = (show pizza) <> \" - $\" <> (show (price (pizza)))","startRow":37,"startColumn":0,"endRow":38,"endColumn":71}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"showPizzaPrice :: Pizza -> String\nshowPizzaPrice pizza = (show pizza) <> \" - $\" <> (show (price (pizza)))","commentTags":[],"questionCommentData":null}],"226cf3b4-be6a-49a5-b311-5b3ff7509141":[{"id":"f056deab-93b9-4d85-b60a-0a77f4a72565","displayCommentEventId":"226cf3b4-be6a-49a5-b311-5b3ff7509141","displayCommentEventSequenceNumber":1698,"developerGroupId":"f5dce1dd-047e-49d4-b9dc-495ccfaec7ee","timestamp":1693867236952,"commentText":"And let's call this new function from our <span style=\"font-family: Courier;\">main</span> declaration, so we can see the descriptions of our pizzas along with their prices.","commentTitle":"Completing the model","position":0,"selectedCodeBlocks":[{"fileId":"ae66c597-1aa7-4fb0-b11a-3f8a8f89ec81","selectedText":"main = do \n        putStrLn (showPizzaPrice (SpecialPie Combo))\n        putStrLn (showPizzaPrice (OneToppingPie EighteenInch Regular Pepperoni))\n        putStrLn (showPizzaPrice (OneToppingPie TenInch GlutenFree Chicken))\n        putStrLn (showPizzaPrice (TwoToppingPie TenInch Regular Olive Mushroom))\n","startRow":0,"startColumn":0,"endRow":5,"endColumn":0}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"main = do \n        putStrLn (showPizzaPrice (SpecialPie Combo))\n        putStrLn (showPizzaPrice (OneToppingPie EighteenInch Regular Pepperoni))\n        putStrLn (showPizzaPrice (OneToppingPie TenInch GlutenFree Chicken))\n        putStrLn (showPizzaPrice (TwoToppingPie TenInch Regular Olive Mushroom))\n","commentTags":[],"questionCommentData":null}]};
